import {Container, Row, Col} from 'reactstrap';

const Footer = () => {
    return (
        <footer className='site-footer' >
            <Container>
                <row>
                    <col xs={{size:4, offset:1}} sm='2'>
                        <h5>This will be site navigation!</h5>
                    </col>
                </row>
            </Container>
        </footer>
    );
}

export default Footer;
